import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import axios from 'axios';

const Payment = () => {
  const location = useLocation();
  const { taskerId } = location.state || {};

  // Retrieve user data from session storage
  const hourlyRate = parseFloat(sessionStorage.getItem('hourlyRate')) || 0;
  const userId = sessionStorage.getItem('userId');
  const serviceId = sessionStorage.getItem('serviceId'); 

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [contact, setContact] = useState('');
  const [hours, setHours] = useState(1);
  const [amount, setAmount] = useState(hourlyRate * hours * 100); // In paise

  useEffect(() => {
    const loadRazorpayScript = () => {
      const script = document.createElement('script');
      script.src = 'https://checkout.razorpay.com/v1/checkout.js';
      script.async = true;
      document.body.appendChild(script);
    };
    loadRazorpayScript();
  }, []);

  const handlePayment = async (e) => {
    e.preventDefault();
    if (!window.Razorpay) {
      alert('Razorpay SDK failed to load. Please check your connection.');
      return;
    }

    const totalAmount = hourlyRate * hours * 100;  // Total amount in paise
    const partialAmount = totalAmount / 2;

    const options = {
      key: 'rzp_test_KA0MVYPAHSnecF', // Replace with live key in production
      amount: partialAmount,
      currency: 'INR',
      name: 'Your Company Name',
      description: 'Booking Tasker',
      handler: async (response) => {
        try {
          await axios.post('/api/booking/payment-verification', {
            razorpay_payment_id: response.razorpay_payment_id,
            razorpay_order_id: response.razorpay_order_id,
            razorpay_signature: response.razorpay_signature,
            userId,
            taskerId,
            serviceId,
            totalAmount,
            partialAmount,
            hours,
          });
          alert('Payment successful!');
        } catch (error) {
          alert('Payment verification failed.');
        }
      },
      prefill: { name, email, contact },
      notes: { taskerId },
      theme: { color: '#F37254' },
    };

    const razorpay = new window.Razorpay(options);
    razorpay.open();
  };

  return (
    <div className="payment-container">
      <div className="billing-info">
        <h2>Billing Information</h2>
        <form onSubmit={handlePayment}>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} placeholder="Name" required />
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Email" required />
          <input type="tel" value={contact} onChange={(e) => setContact(e.target.value)} placeholder="Contact" required />
          <input type="number" value={hours} onChange={(e) => setHours(e.target.value)} min="1" required placeholder="Hours" />
          <p>Total Amount: ₹{(hourlyRate * hours).toFixed(2)}</p>
          <button type="submit">Pay Now</button>
        </form>
      </div>
    </div>
  );
};

export default Payment;
